'use client';

import { useState, useMemo } from 'react';

const mockMovies = [
  
  { id: 1, title: 'The Silent Code', image: 'data:image/jpeg;base64,', description: 'A gripping tale of a master hacker racing against time to uncover a global conspiracy. A thriller with heart-pounding action and suspense.', region: 'Hollywood', rating: '8.5/10' },
  { id: 2, title: 'Lost in the Stars', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSnQO7ocOIkMfqtojzV3-eDyfoaZiBzvKc0HQ&s', description: 'Two astronauts on a deep space mission discover a long-lost civilization and must decide the fate of humanity. A visually stunning sci-fi adventure.', region: 'Hollywood', rating: '9.1/10' },
  { id: 3, title: 'The Last Stand', image: 'data:image/jpeg;base64,', description: 'An unlikely group of heroes must defend their ancient city against an unstoppable force. A fantasy epic filled with magic and sacrifice.', region: 'Hollywood', rating: '7.8/10' },
  { id: 4, title: 'City of Neon', image: 'https://i.ytimg.com/vi/swBu-Iied38/sddefault.jpg', description: 'A detective chases a phantom from the past in a futuristic, dystopian city bathed in neon light. A classic film noir with a cyberpunk twist.', region: 'Hollywood', rating: '8.2/10' },

  
  { id: 5, title: 'Thalaiva', image: 'data:image/jpeg;base64,', description: 'An epic historical drama about a legendary warrior-king who rises from humble beginnings to unite his people against a tyrannical empire.', region: 'South Indian', rating: '8.9/10' },
  { id: 6, title: 'Baahubali: The Beginning', image: 'https://upload.wikimedia.org/wikipedia/en/thumb/5/5f/Baahubali_The_Beginning_poster.jpg/250px-Baahubali_The_Beginning_poster.jpg', description: 'A tale of a young man who uncovers his past and must fight for his rightful place as a king. A larger-than-life cinematic experience.', region: 'South Indian', rating: '9.3/10' },
  { id: 7, title: 'Rangasthalam', image: 'data:image/jpeg;base64,', description: 'A powerful rural drama that follows a hearing-impaired man who becomes the voice of justice against an oppressive village president.', region: 'South Indian', rating: '8.7/10' },

  { id: 8, title: 'Lagaan', image: 'data:image/jpeg;base64,', description: 'A small-town farmer challenges a British officer to a game of cricket to avoid paying oppressive taxes. A classic sports drama.', region: 'Bollywood', rating: '9.0/10' },
  { id: 9, title: '3 Idiots', image: 'data:image/jpeg;base64,', description: 'Two friends search for their long-lost companion, while they reminisce about their college life and the lessons they learned.', region: 'Bollywood', rating: '9.2/10' },
  { id: 10, title: 'Dangal', image: 'data:image/jpeg;base64,', description: 'A former wrestler trains his two daughters to become world-class wrestlers, defying societal norms. A biographical sports drama.', region: 'Bollywood', rating: '9.5/10' },

  { id: 11, title: 'Spirited Away', image: 'data:image/jpeg;base64,', description: 'A young girl wanders into a world ruled by gods, witches, and spirits, and where humans are changed into beasts.', region: 'Anime', rating: '9.4/10' },
  { id: 12, title: 'Your Name', image: 'data:image/jpeg;base64,', description: 'Two teenagers from different worlds discover they are inexplicably linked and must find a way to meet.', region: 'Anime', rating: '9.0/10' },
  { id: 13, title: 'Princess Mononoke', image: 'data:image/jpeg;base64,', description: 'A young prince seeks a cure for a cursed wound in a forest where a powerful princess and a community of animal gods are fighting to survive.', region: 'Anime', rating: '9.2/10' },
];

const MovieCard = ({ movie, onButtonClick, onCardClick, buttonText, isPlaylist = false }) => (
  <div
    className="bg-gray-800 rounded-2xl shadow-xl hover:shadow-2xl overflow-hidden flex flex-col h-full transition-all duration-300 transform hover:scale-105 cursor-pointer"
    onClick={() => onCardClick(movie)}
  >
    <img
      src={movie.image}
      alt={movie.title}
      className="w-full h-72 object-cover"
    />
    <div className="p-5 flex-grow flex flex-col">
      <h3 className="text-xl font-bold text-white mb-2">{movie.title}</h3>
      <p className="text-sm text-gray-400 flex-grow">{movie.description}</p>
      <button
        onClick={(e) => { e.stopPropagation(); onButtonClick(movie); }}
        className={`mt-4 w-full py-3 px-4 rounded-xl font-semibold transition-all duration-300
          ${isPlaylist ? 'bg-red-600 hover:bg-red-700 shadow-lg' : 'bg-blue-600 hover:bg-blue-700 shadow-lg'}`}
      >
        {buttonText}
      </button>
    </div>
  </div>
);

const MovieDetailModal = ({ movie, onClose }) => {
  if (!movie) return null;

  return (
    <div className="fixed inset-0 bg-black bg-opacity-75 flex items-center justify-center z-50 p-4" onClick={onClose}>
      <div
        className="bg-gray-800 rounded-2xl shadow-2xl overflow-hidden max-w-2xl w-full max-h-full md:max-h-[90vh] flex flex-col md:flex-row transition-transform duration-300 transform scale-95 md:scale-100"
        onClick={e => e.stopPropagation()}
      >
        <div className="relative w-full md:w-1/2 flex-shrink-0 h-64 md:h-auto">
          <img
            src={movie.image}
            alt={movie.title}
            className="w-full h-full object-cover"
          />
        </div>
        <div className="p-6 md:p-8 flex flex-col justify-between overflow-y-auto">
          <div>
            <h2 className="text-3xl font-extrabold text-white mb-2">{movie.title}</h2>
            <div className="flex items-center text-yellow-400 mb-4">
              <span className="text-2xl mr-2">
                <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" viewBox="0 0 24 24" fill="currentColor">
                  <path d="M12 17.27l6.18 3.73-1.64-7.03L22 9.24l-7.19-.61L12 2 9.19 8.63 2 9.24l5.46 4.73-1.64 7.03z"/>
                </svg>
              </span>
              <span className="text-xl font-semibold">{movie.rating}</span>
            </div>
            <p className="text-gray-300 mb-6">{movie.description}</p>
          </div>
          <button
            onClick={onClose}
            className="mt-4 md:mt-0 w-full py-3 px-4 rounded-xl font-semibold bg-blue-600 hover:bg-blue-700 shadow-lg transition-colors duration-300"
          >
            Close
          </button>
        </div>
      </div>
    </div>
  );
};

const App = () => {
  const [view, setView] = useState('home');
  
  const [playlist, setPlaylist] = useState([]);
 
  const [searchQuery, setSearchQuery] = useState('');
  
  const [filter, setFilter] = useState('all');
  
  const [selectedMovie, setSelectedMovie] = useState(null);

  const [theme, setTheme] = useState('dark');

  const themes = useMemo(() => ({
    dark: {
      bg: 'bg-gray-950',
      text: 'text-gray-100',
      navBg: 'bg-gray-900',
      navBorder: 'border-gray-800',
      cardBg: 'bg-gray-800',
      placeholder: 'placeholder-gray-400',
      buttonBg: 'bg-gray-700',
      buttonHoverBg: 'hover:bg-gray-600',
      accentBg: 'bg-blue-600',
      accentHoverBg: 'hover:bg-blue-700',
    },
    light: {
      bg: 'bg-gray-100',
      text: 'text-gray-900',
      navBg: 'bg-white',
      navBorder: 'border-gray-200',
      cardBg: 'bg-white',
      placeholder: 'placeholder-gray-500',
      buttonBg: 'bg-gray-300',
      buttonHoverBg: 'hover:bg-gray-400',
      accentBg: 'bg-indigo-600',
      accentHoverBg: 'hover:bg-indigo-700',
    },
    vibrant: {
      bg: 'bg-purple-900',
      text: 'text-yellow-50',
      navBg: 'bg-purple-800',
      navBorder: 'border-purple-700',
      cardBg: 'bg-purple-700',
      placeholder: 'placeholder-purple-200',
      buttonBg: 'bg-purple-600',
      buttonHoverBg: 'hover:bg-purple-500',
      accentBg: 'bg-pink-600',
      accentHoverBg: 'hover:bg-pink-700',
    },
  }), []);

  
  const currentTheme = themes[theme];


  const allMovies = useMemo(() => mockMovies, []);


  const filteredMovies = useMemo(() => {
    let moviesToDisplay = allMovies;

   
    if (filter !== 'all') {
      moviesToDisplay = allMovies.filter(movie => movie.region === filter);
    }

  
    if (searchQuery) {
      moviesToDisplay = moviesToDisplay.filter(movie =>
        movie.title.toLowerCase().includes(searchQuery.toLowerCase())
      );
    }

    return moviesToDisplay;
  }, [allMovies, searchQuery, filter]);

  
  const handleAddToPlaylist = (movie) => {
   
    if (!playlist.some(item => item.id === movie.id)) {
      setPlaylist(prevPlaylist => [...prevPlaylist, movie]);
    }
  };

  
  const handleRemoveFromPlaylist = (movieToRemove) => {
    setPlaylist(prevPlaylist => prevPlaylist.filter(movie => movie.id !== movieToRemove.id));
  };
  const handleShowDetails = (movie) => {
    setSelectedMovie(movie);
  };

  
  const handleCloseDetails = () => {
    setSelectedMovie(null);
  };

  return (
    <div className={`min-h-screen font-sans flex flex-col transition-colors duration-500 ${currentTheme.bg} ${currentTheme.text}`}>
      {/* Nav */}
      <nav className={`shadow-lg sticky top-0 z-50 border-b ${currentTheme.navBg} ${currentTheme.navBorder}`}>
        <div className="container mx-auto px-6 py-4 flex flex-col justify-between items-center space-y-4">
          <div className="flex flex-col md:flex-row justify-between items-center w-full space-y-4 md:space-y-0">
            <h1 className="text-3xl font-extrabold text-blue-500 tracking-wider md:mr-auto">MovieSphere</h1>
            <div className="flex flex-col md:flex-row items-center w-full md:w-auto">
              <input
                type="text"
                placeholder="Search movies..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className={`w-full md:w-64 px-4 py-2 rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 transition-all duration-300 ${currentTheme.cardBg} ${currentTheme.text} ${currentTheme.placeholder}`}
              />
            </div>
            {/* Flexb */}
            <div className="flex flex-nowrap justify-center gap-2 overflow-x-auto py-2 w-full md:w-auto">
              <button
                onClick={() => { setFilter('all'); setView('home'); }}
                className={`flex-shrink-0 py-2 px-4 rounded-xl font-semibold whitespace-nowrap transition-colors duration-300
                  ${filter === 'all' && view === 'home' ? `${currentTheme.accentBg} text-white shadow-md` : `${currentTheme.buttonBg} ${currentTheme.buttonHoverBg}`}`}
              >
                All Movies
              </button>
              <button
                onClick={() => { setFilter('Hollywood'); setView('home'); }}
                className={`flex-shrink-0 py-2 px-4 rounded-xl font-semibold whitespace-nowrap transition-colors duration-300
                  ${filter === 'Hollywood' && view === 'home' ? `${currentTheme.accentBg} text-white shadow-md` : `${currentTheme.buttonBg} ${currentTheme.buttonHoverBg}`}`}
              >
                Hollywood
              </button>
              <button
                onClick={() => { setFilter('Bollywood'); setView('home'); }}
                className={`flex-shrink-0 py-2 px-4 rounded-xl font-semibold whitespace-nowrap transition-colors duration-300
                  ${filter === 'Bollywood' && view === 'home' ? `${currentTheme.accentBg} text-white shadow-md` : `${currentTheme.buttonBg} ${currentTheme.buttonHoverBg}`}`}
              >
                Bollywood
              </button>
              <button
                onClick={() => { setFilter('South Indian'); setView('home'); }}
                className={`flex-shrink-0 py-2 px-4 rounded-xl font-semibold whitespace-nowrap transition-colors duration-300
                  ${filter === 'South Indian' && view === 'home' ? `${currentTheme.accentBg} text-white shadow-md` : `${currentTheme.buttonBg} ${currentTheme.buttonHoverBg}`}`}
              >
                South Indian
              </button>
              <button
                onClick={() => { setFilter('Anime'); setView('home'); }}
                className={`flex-shrink-0 py-2 px-4 rounded-xl font-semibold whitespace-nowrap transition-colors duration-300
                  ${filter === 'Anime' && view === 'home' ? `${currentTheme.accentBg} text-white shadow-md` : `${currentTheme.buttonBg} ${currentTheme.buttonHoverBg}`}`}
              >
                Anime
              </button>
            </div>
          </div>
          {/* My  */}
          <div className="flex justify-center items-center gap-4 w-full md:w-auto mt-4 md:mt-0">
            <button
              onClick={() => setView('playlist')}
              className={`relative flex-shrink-0 py-2 px-4 rounded-xl font-semibold whitespace-nowrap transition-colors duration-300
                ${view === 'playlist' ? `${currentTheme.accentBg} text-white shadow-md` : `${currentTheme.buttonBg} ${currentTheme.buttonHoverBg}`}`}
            >
              My Playlist
              {playlist.length > 0 && (
                <span className="absolute top-0 right-0 transform translate-x-1/2 -translate-y-1/2 bg-red-600 text-white text-xs font-bold px-2 py-1 rounded-full border-2 border-gray-900 animate-pulse">
                  {playlist.length}
                </span>
              )}
            </button>
            {/* Theme Switcher Buttons */}
            <div className="flex gap-2 justify-center">
              <button
                onClick={() => setTheme('dark')}
                className={`w-8 h-8 rounded-full border-2 transition-all duration-300 ${theme === 'dark' ? 'border-blue-500 scale-110' : 'border-gray-700'}`}
                style={{ backgroundColor: '#111827' }}
                title="Dark Theme"
              ></button>
              <button
                onClick={() => setTheme('light')}
                className={`w-8 h-8 rounded-full border-2 transition-all duration-300 ${theme === 'light' ? 'border-indigo-500 scale-110' : 'border-gray-300'}`}
                style={{ backgroundColor: '#F3F4F6' }}
                title="Light Theme"
              ></button>
              <button
                onClick={() => setTheme('vibrant')}
                className={`w-8 h-8 rounded-full border-2 transition-all duration-300 ${theme === 'vibrant' ? 'border-pink-500 scale-110' : 'border-purple-700'}`}
                style={{ backgroundColor: '#4C1D95' }}
                title="Vibrant Theme"
              ></button>
            </div>
          </div>
        </div>
      </nav>

      <div className="container mx-auto p-8 flex-grow">
        {/* Conditional rendering based on the current view */}
        {view === 'home' ? (
          <div>
            <h2 className={`text-4xl md:text-5xl font-extrabold mb-10 text-center ${currentTheme.text}`}>
              {filter === 'all' ? 'Featured Movies' : `${filter} Movies`}
            </h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8">
              {filteredMovies.length > 0 ? (
                filteredMovies.map(movie => (
                  <MovieCard
                    key={movie.id}
                    movie={movie}
                    onButtonClick={handleAddToPlaylist}
                    onCardClick={handleShowDetails}
                    buttonText="Add to Playlist"
                  />
                ))
              ) : (
                <p className={`text-center text-xl col-span-full mt-16 ${currentTheme.text}`}>
                  Sorry, no movies match your search.
                </p>
              )}
            </div>
          </div>
        ) : (
          <div>
            <h2 className={`text-4xl md:text-5xl font-extrabold mb-10 text-center ${currentTheme.text}`}>My Playlist</h2>
            {playlist.length > 0 ? (
              <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8">
                {playlist.map(movie => (
                  <MovieCard
                    key={movie.id}
                    movie={movie}
                    onButtonClick={handleRemoveFromPlaylist}
                    onCardClick={handleShowDetails}
                    buttonText="Remove"
                    isPlaylist={true}
                  />
                ))}
              </div>
            ) : (
              <p className={`text-center text-xl mt-16 ${currentTheme.text}`}>
                Your playlist is empty. Add some movies from the main page!
              </p>
            )}
          </div>
        )}
      </div>

      {/* Render the modal if a movie is selected */}
      <MovieDetailModal movie={selectedMovie} onClose={handleCloseDetails} />

      {/* Expanded Footer with responsive sections */}
      <footer className={`py-12 mt-12 border-t ${currentTheme.navBg} ${currentTheme.navBorder}`}>
        <div className="container mx-auto px-6 grid grid-cols-1 md:grid-cols-3 gap-8 text-center md:text-left">
          {/* About Section */}
          <div className="space-y-2">
            <h4 className="text-xl font-bold mb-2 text-blue-500">About MovieSphere</h4>
            <p className="text-sm">Your ultimate guide to the world of cinema. We provide curated movie lists and personalized playlists to enhance your movie-watching experience.</p>
          </div>
          {/* Quick Links Section */}
          <div className="space-y-2">
            <h4 className="text-xl font-bold mb-2 text-blue-500">Quick Links</h4>
            <ul className="text-sm space-y-1">
              <li><a href="#" className="hover:text-blue-400 transition-colors duration-300">Home</a></li>
              <li><a href="#" className="hover:text-blue-400 transition-colors duration-300">My Playlist</a></li>
              <li><a href="#" className="hover:text-blue-400 transition-colors duration-300">Privacy Policy</a></li>
              <li><a href="#" className="hover:text-blue-400 transition-colors duration-300">Terms of Service</a></li>
            </ul>
          </div>
          {/* Contact & Social Section */}
          <div className="space-y-2">
            <h4 className="text-xl font-bold mb-2 text-blue-500">Contact Us</h4>
            <p className="text-sm">Email: <a href="mailto:info@moviesphere.com" className="hover:text-blue-400 transition-colors duration-300">info@moviesphere.com</a></p>
            <div className="flex justify-center md:justify-start space-x-4 mt-4">
              <a href="#" className="text-xl hover:text-blue-400 transition-colors duration-300"><i className="fab fa-facebook"></i></a>
              <a href="#" className="text-xl hover:text-blue-400 transition-colors duration-300"><i className="fab fa-twitter"></i></a>
              <a href="#" className="text-xl hover:text-blue-400 transition-colors duration-300"><i className="fab fa-instagram"></i></a>
            </div>
          </div>
        </div>
        <div className="container mx-auto px-6 mt-8 pt-4 border-t border-gray-700 text-center">
          <p className="text-sm text-gray-400">&copy; {new Date().getFullYear()} MovieSphere. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default App;
